import React from 'react';
import { NavLink } from "react-router-dom";

const headerStyle ={
    backgroundColor: "grey",
    height: "100%"
}

const divStyle = {
    float: "left",
}

const linkStyles = {
    width: "100px",
    padding: "12px",
    margin: "0 6px 6px",
    color: "black",
    textDecoration: "none"
  };


function Header() {
    return (
        <header style={headerStyle}>
            <div id="logo">
            <h1>DunderList</h1>
            </div>
            <div id="navBar">
                <NavLink exact to="/" style={linkStyles}> Shop</NavLink>
                <NavLink to="/sell" style={linkStyles}>Sell</NavLink>
                <NavLink to="/about" style={linkStyles}>About</NavLink>
                <NavLink to="/cart" style={linkStyles}>Cart</NavLink>
            </div>
        </header>
    )
}

export default Header
